 THE HIGH COURT OF JUSTICE</p>\r\n\r\n<p>SAN FERNANDO</p>\r\n\r\n<p><strong>Claim No: CV 2018-03042</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>IN THE MATTER OF AN APPLICATION BY</p>\r\n\r\n<p>DERYCK CHOTE (REGIMENTAL NUMBER 12257)FOR AN ADMINISTRATIVE ORDER UNDER PART 56 OF THE CIVIL PROCEEDINGS RULES 1998</p>\r\n\r\n<p>AND</p>\r\n\r\n<p>IN THE MATTER OF THE UNFAIR TREATMENT AND/OR UNEQUAL TREATMENT OF THE APPLICANT/CLAIMANT IN BREACH OF HIS RIGHT AND/OR LEGITIMATE EXPECTATION TO BE AWARDED 35 POINTS IN LIGHT OF HIS PASS IN THE QUALIFYING EXAMINATION IN ENGLISH LANGUAGE FOR THE PURPOSE OF BEING EVALUATED AND/OR</p>\r\n\r\n<p>CONSIDERED FOR PROMOTION TO THE RANK</p>\r\n\r\n<p>OF POLICE SERGEANT</p>\r\n\r\n<p>AND</p>\r\n\r\n<p>IN THE MATTER OF THE VIOLATION OF THE CLAIMANT&rsquo;S</p>\r\n\r\n<p>CONSTITUTIONAL RIGHT TO EQUALITY OF TREATMENT FROM</p>\r\n\r\n<p>A PUBLIC AUTHORITY IN THE</p>\r\n\r\n<p>EXERCISE OF ITS FUNCTIONS UNDER SECTION 4(d)</p>\r\n\r\n<p>OF THE CONSTITUTION OF THE</p>\r\n\r\n<p>REPUBLIC OF TRINIDAD AND TOBAGO ACT NO. 4 OF 1976</p>\r\n\r\n<p>BETWEEN</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>DERYCK CHOTE</strong></p>\r\n\r\n<p><strong>(REGIMENTAL NUMBER 12257)</strong></p>\r\n\r\n<p>CLAIMANT</p>\r\n\r\n<p>AND</p>\r\n\r\n<p><strong>THE COMMISSIONER OF POLICE</strong></p>\r\n\r\n<p>1ST DEFENDANT</p>\r\n\r\n<p>AND</p>\r\n\r\n<p><strong>&nbsp;THE ATTORNEY GENERAL OF TRINIDAD AND TOBAGO </strong></p>\r\n\r\n<p>2ND DEFENDANT</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>***************</strong></p>\r\n\r\n<p><strong>CLAIMANT&rsquo;S STATEMENT OF COSTS</strong></p>\r\n\r\n<p><strong>***************</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Basis of Assessment</strong><strong>:</strong></p>\r\n\r\n<p>The Claimant&rsquo;s Statement of Costs is presented for assessment pursuant to the <strong>order of the Honourable Mister Justice Kevin Ramcharan dated August 14th 2020</strong>, whereby he ordered that the Defendants pay the Claimant&rsquo;s costs, to be assessed by the Registrar in default of agreement certified fit for Senior and Junior Counsel. A copy of the order dated August 14th 2020, is annexed as <strong>&ldquo;A&rdquo;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Rates of Remuneration:</strong></p>\r\n\r\n<p>The Statement of Costs is prepared in accordance with the Practice Direction issued by the <strong>Chief Justice</strong> dated <strong>October 20, 2016.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Senior Counsel appearing for the Claimant was:</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mr. Anand Ramlogan whose hourly rate is <strong>$4000.00 (Band E)</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Junior Counsel appearing for the Claimant was:</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mr. Gerald Ramdeen whose hourly rate is <strong>$2300.00 (Band C)</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Instructing attorney on behalf of the Claimant was:</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Ms. Alana Rambaran whose hourly rate is <strong>$750.00 (Band A)</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Claimant also seeks <strong>VAT</strong> on the sums awarded for the High Court proceedings as all Attorneys appearing at the matter were employees of Freedom Law Chambers a firm which is VAT registered as carries the registration number 128253.&nbsp; The Claimant himself is not Vat registered.&nbsp; A copy of the firm&rsquo;s Vat Certificate is annexed as <strong>&ldquo;B&rdquo;.</strong></p>\r\n\r\n<p><strong>Summary of Proceedings:</strong></p>', '<p>This statement of Costs was filed by Mr. Robert Abdool-Mitchell, Attorney-at-Law of Freedom Law Chambers, No. 3 Harris Street San Fernando, Instructing Attorney at law for the Claimant.</p>\r\n\r\n<p>This statement of Costs would be assessed before the Registrar in Chambers at the Supreme Court San Fernando on ___________ the ____ day of _____________ 2022 at _______ am/pm in courtroom SF 17 or via virtual hearing.</p>\r\n\r\n<p>&nbsp;Dated this 14h day of July 2022.</p>\r\n\r\n<p>__________________________</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Robert Abdool-Mitchell </strong></p>\r\n\r\n<p>Freedom Law Chambers</p>\r\n\r\n<p><strong>Attorney at law for the Claimant</strong><strong> </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n\r\n<p>To:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Assistant Registrar</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; High Court of Justice</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Harris Street</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; San Fernando</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>And To:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ms. Michelle Benjamin</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Attorney-at- Law</p>\r\n\r\n<p>Chief State Solicitor Department</p>\r\n\r\n<p>16th Floor, Tower C</p>\r\n\r\n<p>International Waterfront Centre</p>\r\n\r\n<p>1A Wrightson Road</p>\r\n\r\n<p>Port of Spain</p>\r\n\r\n<p><strong>Attorneys-at-Law for the Respondent</strong></p>', '566556', '45', '5454', 0),
